import React from 'react';

function Nav() {
  return (
      <nav className="px-4 py-1 bg-body-tertiary">
        <div className="navbarr">
          <a className="navbar-brand" href='/'>
            <img src="img/HealthyNutritionSinBackground.png" alt="wew" width={20} height={20} />
          </a>
                <a className="nav-link" aria-current="page" href='/tablas'>
                  Tabla nutricional
                </a>
        </div>
      </nav>
  );
}

export default Nav;
